import React from 'react';
import UserItem from './UserItem/UserItem';

const UserList: React.FC = () => {
    const handleDragStop = (e: any, data: { x: number; y: number }) => {
        console.log('Нові координати:', data.x, data.y);
    };

    return (
        <div className="flex flex-col justify-center w-[500px] border border-black mx-auto rounded-lg">
            <h1 className='py-7 text-3xl text-center'>Users</h1>
            <ul>
                <li>
                    <UserItem
                        id={1}
                        userName="John"
                        userLastName="Doe"
                        age={28}
                        position={{ x: 0, y: 0 }}
                        onDragStop={handleDragStop}
                    />
                </li>
                <li>
                    <UserItem
                        id={2}
                        userName="Jane"
                        userLastName="Smith"
                        age={32}
                        position={{ x: 0, y: 0 }}
                        onDragStop={handleDragStop}
                    />
                </li>
            </ul>
        </div>
    );
};

export default UserList;
